import React from 'react';
import styled from '@emotion/styled';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import { theme } from '../../styles/theme';
import type { HomeContent } from '../../pages/Home/types';
import { defaultContent } from '../../pages/Home/types';

interface CircleProps {
  size: string;
  top?: string;
  left?: string;
  right?: string;
  bottom?: string;
  color: string;
}

const HeroSection = styled.section`
  min-height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 40px 20px;
  position: relative;
  overflow: hidden;
  background: linear-gradient(135deg, #FF6B6B 0%, #845EC2 100%);
`;

const HeroContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  text-align: center;
  color: white;
  position: relative;
  z-index: 1;
`;

const Title = styled(motion.h1)`
  font-size: 48px;
  font-weight: bold;
  margin-bottom: 20px;

  @media (max-width: 768px) {
    font-size: 36px;
  }
`;

const Subtitle = styled(motion.p)`
  font-size: 24px;
  margin-bottom: 40px;
  max-width: 800px;
  margin-left: auto;
  margin-right: auto;

  @media (max-width: 768px) {
    font-size: 18px;
  }
`;

const ButtonGroup = styled(motion.div)`
  display: flex;
  gap: 20px;
  justify-content: center;
  flex-wrap: wrap;
  margin-bottom: 60px;
`;

const Button = styled(Link)`
  padding: 15px 30px;
  border-radius: 30px;
  font-size: 18px;
  font-weight: 500;
  text-decoration: none;
  transition: all 0.3s ease;

  &:hover {
    transform: translateY(-2px);
  }
`;

const PrimaryButton = styled(Button)`
  background-color: white;
  color: #FF6B6B;

  &:hover {
    background-color: #f8f8f8;
    box-shadow: 0 4px 12px rgba(255, 255, 255, 0.2);
  }
`;

const SecondaryButton = styled(Button)`
  background-color: transparent;
  border: 2px solid white;
  color: white;

  &:hover {
    background-color: rgba(255, 255, 255, 0.1);
  }
`;

const Stats = styled(motion.div)`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 30px;
  margin-top: 60px;
`;

const StatItem = styled.div`
  text-align: center;
`;

const StatNumber = styled.div`
  font-size: 36px;
  font-weight: bold;
  margin-bottom: 10px;
`;

const StatText = styled.div`
  font-size: 18px;
  opacity: 0.9;
`;

const Hero: React.FC<HomeContent> = ({
  heroTitle,
  heroSubtitle,
  ctaButtonApp,
  ctaButtonAppLink,
  ctaButtonSponsor,
  ctaButtonSponsorLink,
  ctaButtonSignup,
  ctaButtonSignupLink,
  ctaButtonNewsletter,
  ctaButtonNewsletterLink,
  stats
}) => {
  return (
    <HeroSection>
      <HeroContent>
        <Title
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          {heroTitle}
        </Title>
        <Subtitle
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.2 }}
        >
          {heroSubtitle}
        </Subtitle>
        <ButtonGroup
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.4 }}
        >
          <PrimaryButton to={ctaButtonAppLink}>
            {ctaButtonApp}
          </PrimaryButton>
          <SecondaryButton to={ctaButtonSponsorLink}>
            {ctaButtonSponsor}
          </SecondaryButton>
          <SecondaryButton to={ctaButtonSignupLink}>
            {ctaButtonSignup}
          </SecondaryButton>
          <SecondaryButton to={ctaButtonNewsletterLink}>
            {ctaButtonNewsletter}
          </SecondaryButton>
        </ButtonGroup>
        <Stats
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.6 }}
        >
          <StatItem>
            <StatNumber>{stats.users}</StatNumber>
            <StatText>{stats.usersText}</StatText>
          </StatItem>
          <StatItem>
            <StatNumber>{stats.groups}</StatNumber>
            <StatText>{stats.groupsText}</StatText>
          </StatItem>
          <StatItem>
            <StatNumber>{stats.support}</StatNumber>
            <StatText>{stats.supportText}</StatText>
          </StatItem>
        </Stats>
      </HeroContent>
    </HeroSection>
  );
};

Hero.defaultProps = defaultContent;

export default Hero;
